import React, { Component } from "react";
import { Layout, Menu, Breadcrumb, Icon, Input } from "antd";
const Search = Input.Search;
class Header extends Component {
  render() {
    return (
      <div>
        <Search
          placeholder="input search text"
          style={{ width: 200 }}
        />

        <Menu theme="dark" mode="horizontal" title="dm">
          <Menu.Item key="1">Air Jordan</Menu.Item>
          <Menu.Item key="2">Nike</Menu.Item>
          <Menu.Item key="3">Adidas</Menu.Item>
          <Menu.Item key="4">Converse</Menu.Item>
          <Menu.Item key="5">Yeezy</Menu.Item>
        </Menu>
      </div>
    );
  }
}

export default Header;
